from time import time


def insertionSort(Unsorted):
#     print(range(len(Unsorted), 1))
    # Traverse through 1 to len(arr)
    for o in range(1,len(Unsorted)) :
        i = 27-o-2
        CurrentV = Unsorted[i]
        j = i+1

        while j < len(Unsorted) and CurrentV > Unsorted[j] :
                Unsorted[j-1] = Unsorted[j]
                j += 1
        Unsorted[j-1] = CurrentV
 
 
